export default class Login extends Component {
    constructor(props) {
        super(props)
    
        this.state = {
             message: "hello world"
        }
    }
    
    render() {
        return (
            <div>
                <input placeholder="username"/>
                <input placeholder="password"/>
                <button>Login</button>
            </div>
        )
    }
}
